func TestRunCommand(t *testing.T) {
	var pkeylist  = []string{"/Users/puaking/.ssh/test"}
	curip := "118.31.174.25"
	curusername := "root"
	for _, pkey := range pkeylist {
		info := IpInfo{
			Ip:   curip,
			Port: 22,
		}

		config := &ssh.ClientConfig{
			User: curusername,
			Auth: []ssh.AuthMethod{
				PublicKeyAuthFunc(pkey),
			},
			Timeout: time.Duration(2) * time.Second,
			HostKeyCallback: func(hostname string, remote net.Addr, key ssh.PublicKey) error {
				return nil
			},
		}

		client, err := ssh.Dial("tcp", fmt.Sprintf("%v:%v", info.Ip, info.Port), config)
		if err == nil {
			res, err := RunCommand(client, "ssh -o ConnectTimeout=1  root@47.96.128.111 -i /root/.ssh/test whoami")
			if err == nil {
				fmt.Println(res)
			}
		}
	}
}


